"use client"

import {Suspense, useCallback, useRef, useState} from 'react';
import {useRouter, useSearchParams} from 'next/navigation';
import Webcam from 'react-webcam';
import {useGlobalStore} from "@/state/store";


const WebcamCapture = () => {
    const webcamRef = useRef(null);
    const searchParams = useSearchParams()
    const [imgSrc, setImgSrc] = useState(null);
    const setCourseImages = useGlobalStore((state) => state.setCourseImages);
    const router = useRouter();

    const debug = searchParams.get('debug')
    console.log("debug", debug)
    const capture = useCallback(() => {
        // @ts-ignore
        const imageSrc = webcamRef?.current?.getScreenshot();

        setCourseImages(debug ? IMAGE_1 : imageSrc);
        console.log("imageSrc", imageSrc)
        router.push(`/universe-chooser${debug ? '?debug=true' : ''}`);
    }, [webcamRef, setCourseImages, router]);

    const videoConstraints = {
        facingMode: {exact: "environment"}
    };

    return (
        <div className="flex flex-col items-center justify-center min-h-screen py-2">
            <Webcam
                audio={false}
                ref={webcamRef}
                screenshotFormat="image/jpeg"
                className="w-full max-w-md"
                videoConstraints={videoConstraints}
            />
            <button onClick={capture} className="mt-4 p-2 bg-blue-500 text-white rounded">
                Capture photo
            </button>
        </div>
    );
};


const IMAGE_1 = "data:image/jpeg;base64,"


const WebcamCaptureSuspended = () => {
    return (
        // You could have a loading skeleton as the `fallback` too
        <Suspense>
            <WebcamCapture/>
        </Suspense>
    )
}
export default WebcamCaptureSuspended;
